static void bk_green(s32 fx, s32 fy)
{
	s32 x, y;
	static const RECT rect = {0, 0, 64, 32};
	
	//Draw top half
	LoadTex_C16(64, 32, bk_green_tex);
	for (y = -(fy & 0x3F); y < SCREEN_HEIGHT; y += 0x40)
		for (x = -(fx & 0x3F); x < SCREEN_WIDTH; x += 0x40)
			CopyBitmap(&rect, x, y);
	
	//Draw bottom half
	LoadTex_C16(64, 32, bk_green_tex + (128 * 32));
	for (y = -(fy & 0x3F); y < SCREEN_HEIGHT; y += 0x40)
		for (x = -(fx & 0x3F); x < SCREEN_WIDTH; x += 0x40)
			CopyBitmap(&rect, x, y + 32);
}
